'use strict';
import React, {Component, useState} from 'react'; //import R
export class ParagraphTwo extends React.Component {
    render() {
        return (
            <div>
                <h3 class='P_headers'>No Longer Stay a Target</h3>
                <p className='respectYou' id='No_Longer'>
                    It is ideal to avoid manipulators in our life. However, there are situations
                    where we cannot control our surroundings. It is critical to know how to
                    recognize them and be able to work them in a professional setting. The following
                    information will teach you how to recognize them and deal with them in
                    unavoidable circumstances.
                </p>
            </div>
        )
    }
}

export default ParagraphTwo;
